import React from 'react';

class Home extends React.Component {
    render() {
        return (
            <div className="main">

            <h1 id="title">Welcome to Story Gear</h1> 

            <section className="hero">
                <div id="slogan">
                    <h1>Tell Us A Story.</h1>
                </div>
              </section>

             <div className="concept">
                <p>Express your ideas with the best products out there. Tell the world what goes on in your head. Picture a story. Capture it. Do it again. Do it better.</p>
              </div> 

            <div id="slider">
                <img name="slider" width="90%" alt="various images of said camera equipment"/>
            </div>

            </div>
        )
    }
}

export default Home
